import React, { useState } from "react";
import UserItem from "./UserItem";
const Users = (props) => {
  const { usersDB } = props;
  return (
    <div className="users-list">
      {usersDB.map((user) => (
        <UserItem key={user.id} username={user.username} age={user.age} />
      ))}
    </div>
  );
};

export default Users;
